import{_ as r,c as t,a as h,e as s,r as l,o as i}from"./app.109432a7.js";const f=JSON.parse('{"title":"\uC2E0\uCCB4\uAC80\uC0AC","description":"","frontmatter":{"title":"\uC2E0\uCCB4\uAC80\uC0AC","createBy":"2023-02-20T00:00:00.000Z"},"headers":[{"level":2,"title":"","slug":"\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}"},{"level":2,"title":"(1) \uC2E0\uCCB4\uAC80\uC0AC\uBC1B\uC73C\uB7EC \uAC00\uB294\uAE38","slug":"_1-\uC2E0\uCCB4\uAC80\uC0AC\uBC1B\uC73C\uB7EC-\uAC00\uB294\uAE38"},{"level":2,"title":"(2) \uC2E0\uCCB4\uAC80\uC0AC \uC2DC\uC791","slug":"_2-\uC2E0\uCCB4\uAC80\uC0AC-\uC2DC\uC791"},{"level":2,"title":"(3) \uACB0\uACFC","slug":"_3-\uACB0\uACFC"},{"level":2,"title":"","slug":"\uC624\uB298-\uD55C\uC77C\uB4E4"},{"level":2,"title":"\uB313\uAE00","slug":"\uB313\uAE00"}],"relativePath":"sdhs/2302/230220.md"}'),d={name:"sdhs/2302/230220.md"};function n(o,e,c,p,_,u){const a=l("Comment");return i(),t("div",null,[e[0]||(e[0]=h('<h2 id="\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}" tabindex="-1"><h2 style="font-size:30px;">\uC624\uB298\uC758 \uC77C\uC9C0 \u{1F3AA}</h2> <a class="header-anchor" href="#\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}" aria-hidden="true">#</a></h2><p>\uC624\uB298 \uC2E0\uCCB4\uAC80\uC0AC\uB97C \uBC1B\uC73C\uB7EC \uAC14\uB2E4 \uC654\uB2E4.</p><h2 id="_1-\uC2E0\uCCB4\uAC80\uC0AC\uBC1B\uC73C\uB7EC-\uAC00\uB294\uAE38" tabindex="-1">(1) \uC2E0\uCCB4\uAC80\uC0AC\uBC1B\uC73C\uB7EC \uAC00\uB294\uAE38 <a class="header-anchor" href="#_1-\uC2E0\uCCB4\uAC80\uC0AC\uBC1B\uC73C\uB7EC-\uAC00\uB294\uAE38" aria-hidden="true">#</a></h2><hr><p>\uC624\uB298\uC740 \uC2E0\uCCB4\uAC80\uC0AC\uB97C \uC2E0\uCCAD\uD574\uC11C \uAC80\uC0AC\uB97C \uBC1B\uC73C\uB7EC \uAC00\uB294\uB0A0\uC774\uB2E4. \uB098\uB294 \uC624\uD6C4 1\uC2DC \uAC80\uC0AC\uB85C \uC608\uC57D\uC744 \uC7A1\uC544\uC11C \uC544\uCE68\uC5D0 \uB2A6\uAC8C \uC77C\uC5B4\uB0A0\uC218 \uC788\uC5B4\uC11C \uC88B\uC558\uB2E4. <br><br> \uC11C\uC6B8\uC5D0 \uC2E0\uCCB4\uAC80\uC0AC\uB97C \uBC1B\uC744\uC218 \uC788\uB294 \uACF3\uC740 \uC601\uB4F1\uD3EC\uC5D0 \uC788\uB294 \uC11C\uC6B8\uC9C0\uBC29\uBCD1\uBB34\uCCAD \uBC16\uC5D0 \uC5C6\uC5B4\uC11C \uADF8\uACF3\uC73C\uB85C \uC9C0\uD558\uCCA0\uC744 \uD0C0\uACE0 \uAC14\uB2E4. \uAC00\uBA74\uC11C \uB290\uB080\uAC70\uC9C0\uB9CC \uC810\uC810 \uC5ED\uC73C\uB85C \uAC00\uAE4C\uC6CC\uC9C8\uC218\uB85D \uB0B4 \uB610\uB798 \uC598\uB4E4\uC774 \uB298\uC5B4\uB098\uB294\uAC83\uC774 \uBCF4\uC600\uB2E4. 1\uC2DC \uAC80\uC0AC\uC9C0\uB9CC \uC778\uD130\uB137\uC73C\uB85C \uC774\uAC83\uC800\uAC83 \uCC3E\uC544\uBCF8 \uACB0\uACFC 30\uBD84\uC815\uB3C4 \uC77C\uCC0D \uAC00\uB294\uAC8C \uC88B\uB2E4\uACE0 \uD574\uC11C 2~30\uBD84\uC815\uB3C4 \uBA3C\uC800 \uB3C4\uCC29\uD574\uC11C \uAC74\uBB3C\uC548\uC73C\uB85C \uB4E4\uC5B4\uAC14\uB2E4. \uB4E4\uC5B4\uAC00\uB2C8 \uC0AC\uB78C\uC740 \uBCC4\uB85C \uC5C6\uC5C8\uACE0 \uC904\uC744 \uC11C\uACE0 \uC788\uC5C8\uB294\uB370 \uAC11\uC790\uAE30 \uBC88\uD638\uD45C\uAC00 \uC5C6\uC73C\uBA74 \uC904\uC744 \uC11C\uBA74 \uC548\uB41C\uB2E4\uACE0 \uD558\uBA74\uC11C \uC9C1\uC6D0\uC774 \uB098\uB97C \uCEF4\uD4E8\uD130\uAC00 \uC788\uB294 \uC790\uB9AC\uC5D0 \uC549\uD788\uACE0 \uB300\uAE30\uC2DC\uCF30\uB2E4. <br><br> \uB300\uAE30\uD55C\uC9C0 20\uBD84\uC815\uB3C4 \uC2DC\uAC04\uC774 \uD758\uB800\uB2E4. \uC0AC\uB78C\uC740 \uC810\uC810 \uB9CE\uC544\uC9C0\uACE0 \uC811\uC218\uD558\uB294\uAC74 \uBC88\uD638\uD45C\uB97C \uBC1B\uC740 \uC0AC\uB78C\uB4E4\uB9CC \uC811\uC218\uB97C \uD588\uB2E4. \uBC88\uD638\uD45C\uB97C \uBC1B\uC740 \uC0AC\uB78C\uB4E4\uC5D0 \uC811\uC218\uAC00 \uB05D\uB098\uACE0 \uB0A8\uC740 \uC0AC\uB78C\uB4E4\uC744 \uC904 \uC138\uC6E0\uB294\uB370 \uADF8\uB0E5 \uC904\uC11C\uB294 \uAC83\uB3C4 \uC120\uCC29\uC21C\uC73C\uB85C \uB098\uAC00\uC11C \uC904\uC11C\uB294\uAC70\uC600\uB2E4(<s>\uC774\uB7F4\uAC8C \uD560\uAC70\uBA74 \uB0B4\uAC00 \uAE30\uB2E4\uB9B0 \uC2DC\uAC04\uC740 \uBB50\uAC00 \uB418\uB294\uAC70\uC9C0?</s>). \uAC00\uC11C \uC811\uC218\uB97C \uD558\uACE0 \uB098\uB294 51\uBC88\uC774\uB77C\uB294 \uBC88\uD638\uB97C \uBD80\uC5EC\uBC1B\uC558\uB2E4.</p><h2 id="_2-\uC2E0\uCCB4\uAC80\uC0AC-\uC2DC\uC791" tabindex="-1">(2) \uC2E0\uCCB4\uAC80\uC0AC \uC2DC\uC791 <a class="header-anchor" href="#_2-\uC2E0\uCCB4\uAC80\uC0AC-\uC2DC\uC791" aria-hidden="true">#</a></h2><hr><p>\uC2E0\uCCB4\uAC80\uC0AC \uC904\uC5EC\uC11C \uC2E0\uAC80\uC774 \uC2DC\uC791\uB410\uB2E4. \uC55E\uC5D0\uC11C \uAC04\uB2E8\uD55C \uC124\uBA85\uC744 \uD574\uC92C\uB2E4. \uAE30\uBCF8\uC801\uC73C\uB85C 1\uCE35\uC5D0\uC11C \uCEF4\uD4E8\uD130\uB85C \uBB38\uC81C\uB97C \uD480\uB2E4\uAC00 \uC2DC\uAC04\uC774 \uB418\uBA74 \uBC88\uD638 \uC21C\uC11C\uB300\uB85C 2\uCE35\uC5D0 \uAC00\uC11C \uAC80\uC0AC\uB97C \uBC1B\uACE0 \uC624\uACE0 \uBB38\uC81C\uB97C \uB2E4\uD480\uBA74 \uB098\uB77C\uC0AC\uB791\uCE74\uB4DC\uB97C \uBC1C\uAE09\uBC1B\uC740 \uB2E4\uC74C\uC5D0 3\uCE35\uC5D0 \uAC00\uC11C \uAC80\uC0AC \uACB0\uACFC\uB97C \uB4E3\uACE0 \uADC0\uAC00\uD558\uBA74 \uB418\uB294\uAC83\uC600\uB2E4. <br><br> \uB098\uB3C4 \uB9E8\uCC98\uC74C\uC5D0 \uBB38\uC81C\uB97C \uD480\uB2E4\uAC00 \uC21C\uC11C\uAC00 \uB418\uC11C 2\uCE35\uC73C\uB85C \uC62C\uB77C\uAC00 \uD658\uBCF5\uD558\uACE0 \uAC80\uC0AC\uB97C \uBC1B\uC558\uB2E4. \uC637\uC744\uAC08\uC544 \uC785\uACE0 \uC788\uB294\uB370 \uB0B4\uAC00 \uBC1B\uC740 \uBC14\uC9C0\uAC00 \uAD6C\uBA4D\uC774 \uB098 \uC788\uC5B4\uC11C \uB2E4\uC2DC \uAD50\uD658\uD558\uB290\uB77C \uB9E8 \uB9C8\uC9C0\uB9C9\uC73C\uB85C \uD0C8\uC758\uC2E4\uC5D0\uC11C \uB098\uC654\uB2E4. \uAC80\uC0AC\uB294 \uD53C\uAC80\uC0AC, \uC18C\uBCC0\uAC80\uC0AC, \uD608\uC555\uAC80\uC0AC\uB4F1\uC744 \uD588\uB294\uB370 \uD53C\uAC80\uC0AC\uB97C \uC81C\uC678\uD558\uACE0\uB294 \uBC1B\uC744\uB9CC\uD588\uB2E4. 2\uCE35\uC5D0\uC11C \uAC80\uC0AC\uB97C \uB2E4 \uBC1B\uACE0 1\uCE35\uC5D0\uC11C \uB0B4\uB824\uC640\uC11C \uBB38\uC81C\uB97C \uACC4\uC18D \uD480\uC5C8\uACE0 \uB2E4\uD47C \uB2E4\uC74C\uC5D0\uB294 \uB098\uB77C\uC0AC\uB78C\uCE74\uB4DC\uB97C \uBC1C\uAE09 \uBC1B\uC73C\uB7EC \uCC3D\uAD6C\uB85C \uAC14\uB2E4. \uB09C \uAD6D\uBBFC\uC740\uD589 \uACC4\uC88C\uAC00 \uC788\uC5B4\uC11C \uAD6D\uBBFC\uC740\uD589 \uCE74\uB4DC\uB85C \uBC1C\uAE09 \uBC1B\uC558\uB294\uB370 \uAC80\uC0AC \uBC1B\uB294 \uAC70\uC758 \uBAA8\uB4E0 \uC0AC\uB78C\uC774 \uAD6D\uBBFC\uC740\uD589\uC744 \uC120\uD0DD\uD588\uB294\uC9C0 \uC904\uC774 \uAE38\uC5B4\uC11C \uC880 \uC624\uB798\uAC78\uB838\uB2E4.</p><h2 id="_3-\uACB0\uACFC" tabindex="-1">(3) \uACB0\uACFC <a class="header-anchor" href="#_3-\uACB0\uACFC" aria-hidden="true">#</a></h2><hr><p>\uB098\uB77C\uC0AC\uB791\uCE74\uB4DC\uB97C \uBC1C\uAE09 \uBC1B\uACE0 \uB2E4\uC2DC \uC21C\uC11C\uB300\uB85C \uAC80\uC0AC\uACB0\uACFC\uB97C \uB4E4\uC73C\uB7EC 3\uCE35\uC73C\uB85C \uAC14\uB294\uB370 \uBAB8\uC5D0 \uB531\uD788 \uD2B9\uBCC4\uD55C \uC99D\uC0C1\uC774\uB098 \uB0BC \uBCF4\uACE0\uC11C? \uAC19\uC740\uAC8C \uC5C6\uC5B4\uC11C \uC0DD\uAC01\uBCF4\uB2E4 \uC77C\uCC0D \uB05D\uB0AC\uB2E4. \uCC38\uACE0\uB85C \uD544\uC790\uB294 2\uAE09\uC774 \uB098\uC654\uB2E4. <br><br> \uACB0\uACFC\uB97C \uB4E3\uACE0 \uC9D1\uC5D0 \uAC08\uB824\uACE0 \uB098\uAC00\uB294\uB370 \uCDE8\uC5C5\uB9DE\uCDA4\uD2B9\uAE30\uBCD1\uC744 \uC124\uBA85\uD574\uC8FC\uC2DC\uB294 \uBD84\uD55C\uD14C \uCD9C\uAD6C\uC5D0\uC11C \uC7A1\uD600\uC11C \uD2B9\uAE30\uBCD1\uC73C\uB85C \uAD70\uB300\uC5D0 \uB4E4\uC5B4\uAC08\uBED4\uD588\uB2E4. 3~4\uC2DC\uAC04\uC740 \uAC10\uC548\uD558\uACE0 \uAC80\uC0AC\uB97C \uBC1B\uC73C\uB7EC \uC654\uB294\uB370 2~3\uC2DC\uAC04\uB9CC\uC5D0 \uB05D\uB098\uC11C \uAE30\uBD84\uC774 \uC88B\uC558\uB2E4. \uB3CC\uC544\uAC00\uB294\uAE38\uC5D0 \uAC74\uBB3C\uC55E\uC5D0\uC11C \uBB34\uB9AC\uC9C0\uC5B4\uC11C \uB2F4\uBC30\uD53C\uACE0 \uC788\uB294 \uC0AC\uB78C\uB4E4\uC774 \uC788\uC5C8\uB294\uB370 \uB0B4 \uB610\uB798\uC778\uC9C0\uB294 \uBAA8\uB974\uACA0\uC9C0\uB9CC \uBB34\uC11C\uC6E0\uB2E4.</p><h2 id="\uC624\uB298-\uD55C\uC77C\uB4E4" tabindex="-1"><h2 style="color:#ee4867;font-size:30px;">\uC624\uB298 \uD55C\uC77C\uB4E4</h2> <a class="header-anchor" href="#\uC624\uB298-\uD55C\uC77C\uB4E4" aria-hidden="true">#</a></h2><hr><ul><li>\uC2E0\uCCB4\uAC80\uC0AC \uBC1B\uAE30</li></ul><br><br><h2 id="\uB313\uAE00" tabindex="-1">\uB313\uAE00 <a class="header-anchor" href="#\uB313\uAE00" aria-hidden="true">#</a></h2><hr><br>',19)),s(a)])}var m=r(d,[["render",n]]);export{f as __pageData,m as default};
